    function setTheme_(theme) {
        var currentUrl = document.location.pathname;

        if (!theme || theme == 'black') {
            localStorage.removeItem('theme');
            document.body.className = '';
            return;
        }

        if (theme) {
            document.body.classList.add(theme);
            localStorage.theme = theme;
        }
    }

    function output(html) {
        output_.insertAdjacentHTML('beforeEnd', html);
    }

    function getDocHeight_() {
        var d = document;
        return Math.max(
        Math.max(d.body.scrollHeight, d.documentElement.scrollHeight), Math.max(d.body.offsetHeight, d.documentElement.offsetHeight), Math.max(d.body.clientHeight, d.documentElement.clientHeight));
    }

    return {
        initFS: function (persistent, size) {
            output('<div>Welcome to ' + document.title + '! (v' + VERSION_ + ')</div>');
            output('<span>' + (new Date()).toLocaleString() + '</span>');
            output('<p>Documentation: type "help"</p>');
        },
        output: output,
        setTheme: setTheme_
    }
